  margin: 0 auto;
  max-width: ${(props) => props.theme.maxWidth};
  width: 100%;
`;

function App() {
  const [isLoggedIn, useIsLoggedIn] = useState(false);

  return (
    <Router>
      <Routes />
    </Router>
  );
}

export default App;
